  color : red;
`

const [person, setPerson] = useState([]);

async function fetch() {


  const result = await axios(
    'https://jsonplaceholder.typicode.com/users',
  );

  setPerson(result.data);
  // console.log(person)

}
const Index: React.FunctionComponent = () => {


  useEffect(() => {
    fetch()
  });
  return (
    <Layout title="Home">
